import React, { useEffect } from 'react';
import Chart from 'chart.js/auto';
import {
    AnalyticsSection,
    AnalyticsTitle,
    BarGraph,
    ChartContainer,
    GraphLoadingMessage
} from '../style_Desire';

const Analytics = ({ statistics, isLoading }) => {
    useEffect(() => {
        if (!statistics || isLoading) return;

        // Update price range chart
        updateChart('priceRangeChart', 'Price Range Distribution', statistics.price_range);
        
        // Update constructed area chart
        updateChart('areaChart', 'Constructed Area Distribution', statistics.constructed_area);
        
        // Update rooms chart
        updateChart('roomsChart', 'Number of Rooms Distribution', statistics.rooms);
        
        // Update bathrooms chart
        updateChart('bathroomsChart', 'Number of Bathrooms Distribution', statistics.bathrooms);
    }, [statistics, isLoading]);

    const updateChart = (canvasId, title, data) => {
        const canvas = document.getElementById(canvasId);
        if (!canvas) return;

        // Destroy existing chart if it exists
        if (window[canvasId]) {
            window[canvasId].destroy();
        }

        // Create new chart
        window[canvasId] = new Chart(canvas.getContext('2d'), {
            type: 'bar',
            data: {
                labels: data.labels,
                datasets: [{
                    label: title,
                    data: data.counts,
                    backgroundColor: 'rgba(62, 92, 170, 0.7)',
                    borderColor: 'rgba(62, 92, 170, 1)',
                    borderWidth: 1
                }]
            },
            options: {
                responsive: true,
                maintainAspectRatio: false,
                plugins: {
                    legend: {
                        display: false
                    },
                    title: {
                        display: true,
                        text: title,
                        font: {
                            size: 14,
                            weight: 'bold'
                        }
                    }
                },
                scales: {
                    y: {
                        beginAtZero: true,
                        ticks: {
                            stepSize: 1
                        }
                    }
                }
            }
        });
    };

    if (isLoading) {
        return (
            <AnalyticsSection>
                <GraphLoadingMessage>Loading analytics...</GraphLoadingMessage>
            </AnalyticsSection>
        );
    }

    if (!statistics) {
        return (
            <AnalyticsSection>
                <AnalyticsTitle>No data available</AnalyticsTitle>
            </AnalyticsSection>
        );
    }

    return (
        <AnalyticsSection>
            <AnalyticsTitle>Property Analytics</AnalyticsTitle>
            
            {/* Average Values */}
            <div style={{ marginBottom: '20px', padding: '15px', backgroundColor: '#f5f5f5', borderRadius: '8px' }}>
                <h3 style={{ margin: '0 0 10px 0', color: '#3e5caa' }}>Average Values</h3>
                <div style={{ display: 'grid', gridTemplateColumns: '1fr 1fr', gap: '10px' }}>
                    <div>
                        <strong>Average Price:</strong>
                        <p style={{ margin: '5px 0 0 0', fontSize: '1.2em', color: '#3e5caa' }}>
                            €{statistics.averages.price.toLocaleString()}
                        </p>
                    </div>
                    <div>
                        <strong>Average Area:</strong>
                        <p style={{ margin: '5px 0 0 0', fontSize: '1.2em', color: '#3e5caa' }}>
                            {statistics.averages.area.toFixed(1)}m²
                        </p>
                    </div>
                </div>
            </div>

            {/* Charts */}
            <ChartContainer>
                <BarGraph>
                    <canvas id="priceRangeChart"></canvas>
                </BarGraph>
                <BarGraph>
                    <canvas id="areaChart"></canvas>
                </BarGraph>
                <BarGraph>
                    <canvas id="roomsChart"></canvas>
                </BarGraph>
                <BarGraph>
                    <canvas id="bathroomsChart"></canvas>
                </BarGraph>
            </ChartContainer>
        </AnalyticsSection>
    );
};

export default Analytics;
